import React from 'react';
import { connect } from 'react-redux';

const TaskCollection = (props) => {
  var myCollection = [];
  if (props.taskList) {
    myCollection = props.taskList.map((list) => {
      return <TaskItem list={list} id={list.id}/>
    });
  return (
    <div>myCollection</div>
  );
  }
}

const mapStateToProps = state => {
  return { task: state.taskReducer };
};

export default connect(mapStateToProps)(TaskCollection)
